import React from "react";

export default function Header() {
    return (
        <div className={"flow flow header-container"}>
            <img src={"champ-img.png"} alt={"Man holding up a microphone into the air."}/>
            <h1 className={"fs-500 ff-joesfin"}>We are the Champions!</h1>
            <textarea className={"bg-light radius border main-text"} type={"textarea"} placeholder={"Some text here!"}></textarea>
            <div className={"flex"}>
                <input className={"bg-light radius border text-field"} type={"text"} placeholder={"Some text here!"}></input>
                <input className={"bg-light radius border text-field"} type={"text"} placeholder={"Some text here!"}></input>
            </div>
            <button className={"publish-btn"}>Publish!</button>
        </div>
    )
}
